import React, { useState } from 'react';
import './contact.css';

const Contact = () => {
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        company: '',
        role: '',
        message: '',
        agreeToTerms: false
    });

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: type === 'checkbox' ? checked : value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Form submitted:', formData);
        // Add your form submission logic here
    };

    return (
        <div className="contact-page" style={{ minHeight: '100vh', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', padding: '0', margin: '0' }}>
            {/* Arc Background */}
            <div className="arc-container" style={{ position: 'absolute', width: '100vw', height: '100vh', top: 0, left: 0, zIndex: 0 }}>
                <div className="arc-gradient"></div>
            </div>

            <div className="contact-content" style={{ width: '100%', maxWidth: 420, margin: '0 auto', zIndex: 1, flex: 1, display: 'flex', flexDirection: 'column', justifyContent: 'center' }}>
                {/* Header Section */}
                <div className="contact-header" style={{ textAlign: 'center', marginBottom: 24 }}>
                    <h1 style={{ margin: 0 }}>Get in Touch</h1>
                    <p style={{ margin: 0 }}>Let's create something amazing together</p>
                </div>

                {/* Stacked Form Layout */}
                <div className="form-card no-border no-shadow" style={{ background: 'rgba(255,255,255,0.95)', borderRadius: 16, padding: 24, boxSizing: 'border-box', boxShadow: 'none', width: '100%' }}>
                    <form onSubmit={handleSubmit} className="contact-form stacked-form" style={{ display: 'flex', flexDirection: 'column', gap: 16 }}>
                        <div className="form-group">
                            <input
                                type="text"
                                name="firstName"
                                value={formData.firstName}
                                onChange={handleChange}
                                placeholder="First Name"
                                className="form-input"
                                required
                                style={{ width: '100%' }}
                            />
                        </div>
                        <div className="form-group">
                            <input
                                type="text"
                                name="lastName"
                                value={formData.lastName}
                                onChange={handleChange}
                                placeholder="Last Name"
                                className="form-input"
                                required
                                style={{ width: '100%' }}
                            />
                        </div>
                        <div className="form-group">
                            <input
                                type="email"
                                name="email"
                                value={formData.email}
                                onChange={handleChange}
                                placeholder="Email Address"
                                className="form-input"
                                required
                                style={{ width: '100%' }}
                            />
                        </div>
                        <div className="form-group">
                            <input
                                type="text"
                                name="company"
                                value={formData.company}
                                onChange={handleChange}
                                placeholder="Company Name"
                                className="form-input"
                                style={{ width: '100%' }}
                            />
                        </div>
                        <div className="form-group">
                            <select
                                name="role"
                                value={formData.role}
                                onChange={handleChange}
                                className="form-select"
                                required
                                style={{ width: '100%' }}
                            >
                                <option value="">Select Your Role</option>
                                <option value="developer">Developer</option>
                                <option value="designer">Designer</option>
                                <option value="business">Business</option>
                                <option value="other">Other</option>
                            </select>
                        </div>
                        <div className="form-group">
                            <textarea
                                name="message"
                                value={formData.message}
                                onChange={handleChange}
                                placeholder="Your Message"
                                className="form-textarea"
                                required
                                rows="4"
                                style={{ width: '100%' }}
                            />
                        </div>
                        <div className="form-footer" style={{ display: 'flex', flexDirection: 'column', gap: 12 }}>
                            <div className="terms-checkbox" style={{ display: 'flex', alignItems: 'center', gap: 8 }}>
                                <input
                                    type="checkbox"
                                    name="agreeToTerms"
                                    id="agreeToTerms"
                                    checked={formData.agreeToTerms}
                                    onChange={handleChange}
                                    required
                                />
                                <label htmlFor="agreeToTerms">
                                    I agree to the <a href="/terms">Terms</a> and <a href="/privacy">Privacy Policy</a>
                                </label>
                            </div>
                            <button type="submit" className="submit-button" style={{ width: '100%' }}>
                                Send Message
                            </button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Contact;
